import React from 'react';

class Who extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            return (
                <div id="whoContainer">
                    <div id="whoImg">
                        
                    </div>

                    <div id="whoContent">
                        This here is who we are. We will most likely have one or two sentences explaining our business.
                    </div>


                    <style jsx>
                        {`

                        #whoContainer {
                            height: 100%;
                            width: 200px;
                        }

                        #whoImg {
                            height: 150px;
                            width: 150px;
                            background-color: red;
                            margin: auto;
                            border-radius: 50%;
                        }

                        #whoContent {
                            color: white;
                        }
                        
                        `}
                    </style>
                </div>
            )
        }
    }

export default Who;
